    return(
        <div className="title">
            <div className="title-website-name{">
                <h1 style={{margin:'2rem'}}><Link to="/" style={{textDecoration:'none', color:'white',marginLeft:'1rem'}}>SPORTS ALMANAC</Link></h1>
            </div>
